export default function ValidationEmail() {
  
 

  return (
    <form >
      <h2 className='subtitle'>Confirme seu cadastro</h2>
      <Button fullWidth  variant="contained" color="secondary">
        Confirmar cadastro
      </Button>
    </form>
    
  );
}
